import { Component } from '@angular/core';
import { FormBuilder } from "@angular/forms";
import { AuthorizationService } from "../services/authorization.service";
import { Router } from "@angular/router";
import { CookieService } from "../services/cookie.service";
let LoginComponent = class LoginComponent {
    constructor(formBuilder, auth, router, cookie) {
        this.formBuilder = formBuilder;
        this.auth = auth;
        this.router = router;
        this.cookie = cookie;
        this.form = {};
    }
    ngOnInit() {
        this.form = this.formBuilder.group({
            username: '',
            password: ''
        });
    }
    submit() {
        this.auth.login(this.form.getRawValue()).subscribe({
            next: (data) => {
                this.cookie.setCookie('user', JSON.stringify(data), 60);
                this.cookie.setCookie('credentials', '{"password":"' + this.form.getRawValue().password + '", "username":"' + this.form.getRawValue().username + '"}', 60);
                this.router.navigate(['/user']);
            },
            error: (err => {
                if (err.status === 404) {
                    alert('Wrong Data');
                }
            })
        });
    }
};
